import React from "react"
import Deck from "./Deck"


function DeckList({decks}) {



const list = decks.map((deck,index) => 
    <Deck name={deck.name} description={deck.description} cards={deck[0].cards.length}/>
)

return (
    <div>
        {list}
    </div>
)

}

export default DeckList
